window.bookSummaryJSON = "<p>A betrayed witch. A broken secret. A malevolent destiny.</p> <p>Paladin Agent Alice Skye is desperate to get back on a case, and it doesn’t take long until she gets exactly what she’s asked for. Alice is thrust into a horrific homicide, one that tests her limited knowledge in dark magic, that threatens to destroy not only her, but those she loves.</p> <p>Still in mourning, Alice is trying to get her life back together. However, nothing is quite like it seems when she receives a letter from Dread’s estate. She uncovers a secret, one that should have remained buried. But fate is ticking, for there are those waiting for her in the dark, ready to stop the prophecy that has shadowed her since birth.</p> <p>Can she survive her greatest challenge yet?</p> <p>Or will the Knights, a secret guild of assassins, follow their simple, but deadly creed?</p> <p>Protect the innocent. Slay the corrupt. Defend the realm.</p> <p>Because unfortunately for Alice, she’s their number one target.</p> <p><i>Knight’s War</i> is the fifth instalment in this nail-biting, action packed urban fantasy series by Taylor Aston White. Follow Alice as she battles her Daemons and unveils dark secrets in a modern world of magic.</p> <p>Disclaimer: This novel is written in British English, including spelling and grammar.</p>"; 
